DAR SEGUIMIENTO AL INFORME DE AUDITORÍA; 
ELABORAR EL PROYECTO DE ACUERDO DE RADICACIÓN A TRAVÉS DEL CUAL SE NOTIFICARÁ EL INICIO DE LA ETAPA DE ACLARACIÓN Y LA FECHA PARA LA COMPARECENCIA DE LA ENTIDAD FISCALIZADA; 
DESAHOGAR LA ETAPA DE ACLARACIÓN O, EN SU CASO, EL PROCESO DE RECOMENDACIONES; 
DESAHOGAR LA COMPARECENCIA DE LA ETAPA DE ACLARACIÓN EN LA QUE SE PUNTUALIZARÁN LAS ACCIONES A SOLVENTAR; 
ELABORAR EL PROYECTO DE ACUERDO DE REMISIÓN DE LAS PROMOCIONES DE RESPONSABILIDAD ADMINISTRATIVA SANCIONATORIA A LOS ÓRGANOS INTERNOS DE CONTROL, PARA QUE REALICEN LAS INVESTIGACIONES PERTINENTES Y, EN SU CASO, INICIEN EL PROCEDIMIENTO ADMINISTRATIVO CORRESPONDIENTE; 
PARTICIPAR EN LA ATENCIÓN A LAS ENTIDADES FISCALIZABLES QUE ASÍ LO SOLICITEN; 
ANALIZAR LA INFORMACIÓN Y EL SOPORTE DOCUMENTAL QUE LAS ENTIDADES FISCALIZADAS PRESENTEN SOBRE LAS ACCIONES Y RECOMENDACIONES; 
ANALIZAR LAS RESPUESTAS RECIBIDAS DE LAS ENTIDADES FISCALIZADAS, RESPECTO DE LAS RECOMENDACIONES EMITIDAS; 
LLEVAR A CABO LA PRÁCTICA DE TÉCNICAS DE INSPECCIÓN Y CONFIRMACIÓN PARA LA OBTENCIÓN DE LOS ELEMENTOS TÉCNICOS, JURÍDICOS Y ADMINISTRATIVOS QUE DE SUS ANÁLISIS REQUIERAN PARA ENCAUSAR ADECUADAMENTE LOS RESULTADOS; 
ELABORAR EL PROYECTO DE REQUERIMIENTO A LA ENTIDAD FISCALIZADA DE LAS MEJORAS REALIZADAS Y LAS ACCIONES EMPRENDIDAS, PARA ATENDER LAS RECOMENDACIONES EMITIDAS POR EL ÓRGANO SUPERIOR; 
DAR SEGUIMIENTO A LAS RECOMENDACIONES HASTA SU CONCLUSIÓN;
DAR SEGUIMIENTO AL PROCEDIMIENTO ADMINISTRATIVO REALIZADO POR LOS ÓRGANOS INTERNOS DE CONTROL DERIVADO DE LAS REMISIONES DE LAS PROMOCIONES DE RESPONSABILIDAD ADMINISTRATIVA SANCIONATORIA; 
ELABORAR EL PROYECTO DE ACUERDO DE CONCLUSIÓN DE LA ETAPA DE ACLARACIÓN A LAS ENTIDADES FISCALIZABLES, Y PRESENTARLO A SU SUPERIOR JERÁRQUICO; 
REALIZAR EL PROYECTO DEL DICTAMEN DE SOLVENTACIÓN QUE DETERMINARÁ LAS ACCIONES ACLARADAS O SOLVENTADAS, PARA SU ARCHIVO Y SALVAGUARDA. EN EL CASO DE LAS SOLICITUDES DE ACLARACIÓN NO SOLVENTADAS, FORMULARÁ LOS PROYECTOS DE PLIEGOS DE OBSERVACIONES, QUE SERÁN NOTIFICADOS POR LA UNIDAD ADMINISTRATIVA CORRESPONDIENTE, PARA SU TRAMITACIÓN, Y DE SOLVENTARSE, SE EMITIRÁ EL DICTAMEN CORRESPONDIENTE; 
ELABORAR EL PROYECTO DE ACUERDO DE CONCLUSIÓN Y ARCHIVO POR FALTA DE ELEMENTOS EN LAS ACCIONES QUE DERIVEN DE ACTOS DE FISCALIZACIÓN Y HACERLO DEL CONOCIMIENTO DE SU SUPERIOR JERÁRQUICO, 
LAS DEMÁS QUE LE CONFIERAN OTROS ORDENAMIENTOS LEGALES, MANUALES, LAS DISPOSICIONES JURÍDICAS APLICABLES Y LAS QUE LES ASIGNE SU SUPERIOR JERÁRQUICO

ASISTIR CON VOZ Y VOTO A LAS SESIONES DEL CONSEJO ELECTORAL;
FORMULAR PROYECTOS DE ACUERDO PARA SOMETERLOS A LA CONSIDERACIÓN DEL CONSEJO
ELECTORAL;
FORMULAR VOTOS PARTICULARES;
VELAR POR LA AUTENTICIDAD Y EFECTIVIDAD DEL SUFRAGIO;
PROMOVER, SUPERVISAR Y PARTICIPAR EN LOS PROGRAMAS DE FORMACIÓN CÍVICA Y
CAPACITACIÓN ELECTORAL;
ORIENTAR A LOS CIUDADANOS EN EL EJERCICIO DE SUS DERECHOS Y EN EL CUMPLIMIENTO
DE SUS DEBERES EN MATERIA POLÍTICO ELECTORAL, ETC.
